import {useEffect} from 'react';
import axios from 'axios';

var url = 'http://localhost:8080/';

function GetAccountByID(userID ) {

    useEffect(() => {
        axios.get(url +'accounts/1')
            .then(res=> {
                console.log(res.data)
            }).catch(err => {
            console.log(err)
        })
    },[])
}

export default GetAccountByID;
